import React from "react";
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import "./WalletStyles.css";

const SetWallet = () => {
	return (
		<Card>
			<Box
				sx={{
					width: "auto",
					minWidth: 300,
					height: 500,
				}}
			>
				<>Set Wallet Page</>
			</Box>
		</Card>
	);
}

export default SetWallet;
